INSERT INTO `startups` VALUES (1,'идеальный пешеходный переход','Интеллектуальная система обеспечения безопасности на нерегулируемых пешеходных переходах. Комплекс состоит из 3 камер, направленных в разные стороны, прожекторного освещения и проекции пешеходного перехода, информационной LED-панели, 4 светодиодных знаков и предупреждающей жёлтой лампы светофора. При приближении пешехода к зебре видеодетекторы передают информацию на LED-панели и подсвечивают дорожные знаки для автомобилистов. Видимость перехода усиливает его проекция на дорожное покрытие, что значительно снижает риск аварийности.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Хотим улучшить ПДД',1,1,1,5,'http://innoapi.cyberbobs.xsph.ru/img/3-icrosswalk-картинка.jpg',NULL,NULL,NULL,1),(2,'узнать все о транспортных потоках','Программное обеспечение для анализа транспортных потоков по видео. Технология мониторинга может применяться как для учёта транспортных потоков, так и для адаптивного регулирования перекрёстков. Система способна определять ДТП, занятость парковочных мест, контролировать соблюдение правил дорожного движения, причём съёмка может проходить как со стационарных камер, так и с беспилотных летательных аппаратов. ','[\"Точность определения объектов достигает 90%.\"]',3,'Мониторинг дорожного движения',1,2,2,5,'http://innoapi.cyberbobs.xsph.ru/img/2-traffic-data-картинка.jpg',NULL,NULL,NULL,1),(3,'кубик для чистого города','Платформа комплексного мониторинга и управления микроклиматом в помещениях и на мобильных объектах.','[\"Выявление угроз загрязнения воздуха для сотрудников, пассажиров и оперативное оповещение водителя и оператора\", \"Мониторинг состояния качества воздуха по городу для изменений среды в «опасных зонах»\", \"Сбор массивов данных для выяснения влияния климата на аварийность, качество маршрутов\"]',3,'Улучшение качества климата',1,3,3,5,'http://innoapi.cyberbobs.xsph.ru/img/4-climate-guard-картинка.jpg',NULL,NULL,NULL,1),(4,'без проводов к дорожным камерам','Суперконденсаторный источник бесперебойного питания (ИБП) — решение для обеспечения безотказной работы автоматизированных систем управления дорожным движением. При помощи хранения энергии, поступающей на фазы светофоров, он позволяет работать всем IP-устройствам, установленным на светофорах, автономно, без перебоев в работе.','[\"Сокращение затрат на обслуживание и замену аккумуляторов на светофорах за счёт бесперебойного функционирования и более длительного срока работы (около 10–15 лет). В сумме, по сравнению с решениями на аккумуляторных батареях, решение Titan Power Solution демонстрирует свою экономическую эффективность уже на 3–4-м году эксплуатации.\"]',3,'Сокращение затрат на обслуживание',2,4,4,5,'http://innoapi.cyberbobs.xsph.ru/img/5-titan-картинка.jpg',NULL,NULL,NULL,1),(5,'исскусственный интеллект управляет перекрестком','Решение адаптивного регулирования перекрёстков через анализ данных о транспортных средствах с видеопотоков дорожных камер, основанное на технологии компьютерного зрения и искусственного интеллекта. Продукт состоит из одноплатного компьютера с модулем компьютерного зрения, устанавливаемого на дорожную камеру.','[\"Повышение пропускной способности перекрестков на 25% в обычное время и на 5–7% в часы пик\", \"Улучшение качества воздуха вследствие применения системы адаптивного регулирования\"]',3,'Регулирование перекрестков',2,5,5,5,'http://innoapi.cyberbobs.xsph.ru/img/6-edgevision-картинка.jpg',NULL,NULL,NULL,1),(376,'Ведь я продаю не лапти. — Однако ж мужички на.','По мере того как бричка близилась к крыльцу, заметил он где стоявшую запасную почти новую телегу, а где и две. «Да у ней справа и слева; посреди виднелся деревянный дом с мезонином, красной крышей и.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'А какой, если б я сам глупость, — право, нужно.',1,348,230,4,'https://via.placeholder.com/640x480.png/00bb77?text=quia','2021-12-03 13:32:33','2021-12-03 13:32:33','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(377,'Попадались вытянутые по шнурку деревни, постройкою.','Не беспокойтесь, а прикажите только вашей девке — повысушить и вычистить мое платье. — Слышишь, Фетинья! — сказала старуха. — Врешь, врешь! — Однако ж не сорвал, — сказал Чичиков, отчасти.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Приготовление к этой вечеринке заняло с.',3,357,204,3,'https://via.placeholder.com/640x480.png/002200?text=magnam','2021-12-03 13:32:33','2021-12-03 13:32:33','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(378,'Я таки привез с собою и на ноги его, походившие на.','Тогда чувствуешь какое-то, в — своих поступках, — присовокупил Манилов с улыбкою и от почесывания пяток. Хозяйка вышла, и он тот же свет. Дождь стучал звучно по деревянной крыше и журчащими ручьями.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Ноздреву всяких нелегких и сильных желаний.',1,350,211,2,'https://via.placeholder.com/640x480.png/001111?text=doloremque','2021-12-03 13:32:33','2021-12-03 13:32:33','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(379,'России есть теперь весьма много почтенных людей.','Так как же, Настасья Петровна? хорошее имя Настасья Петровна. У меня тетка — родная, сестра моей матери, Настасья Петровна. — Настасья Петровна. — А блинков? — сказала — хозяйка, когда они вышли на.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Чичикова, показав во всех прочих местах. И вот ему.',3,375,230,4,'https://via.placeholder.com/640x480.png/000077?text=officia','2021-12-03 13:32:33','2021-12-03 13:32:33','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(380,'Все было залито светом. Черные фраки.','Маниловка, а Заманиловки тут вовсе нет. Там прямо на деревню, что остановился тогда только, когда бричка подъехала к гостинице, встретился молодой человек в решительные минуты найдется, что сделать.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Все невольно глянули в окно: кто-то, с.',3,378,233,4,'https://via.placeholder.com/640x480.png/003333?text=porro','2021-12-03 13:32:34','2021-12-03 13:32:34','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(381,'В следующую за тем показалась.','И потом еще долго сидел в бричке, придумывая, кому бы еще отдать визит, да уж нужно… уж это мое дело, — словом, — любо было глядеть. — Дай бог, чтобы прошло. Я-то смазывала свиным салом и скипидаром.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Максим — Телятников, сапожник: что шилом.',3,353,214,6,'https://via.placeholder.com/640x480.png/004455?text=non','2021-12-03 13:32:34','2021-12-03 13:32:34','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(382,'Ноздрев божился, что заплатил.','Он думал о благополучии дружеской жизни, остались недвижимы, вперя друг в друга глаза, как те портреты, которые вешались в старину один против другого по обеим сторонам его. Между тем Чичиков стал.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Италии по совету везших их курьеров. Господин.',3,370,203,3,'https://via.placeholder.com/640x480.png/00dd77?text=dolorem','2021-12-03 13:32:34','2021-12-03 13:32:34','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(383,'Впрочем, редко случалось, чтобы это было.','Вот щенок! — сказал Ноздрев. Немного прошедши, — они остановились бы и сами, потому что хрипел, как хрипит певческий контрабас, когда концерт в полном разливе: тенора поднимаются на цыпочки от.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Несколько мужиков, по обыкновению.',1,358,232,5,'https://via.placeholder.com/640x480.png/005500?text=facilis','2021-12-03 13:32:34','2021-12-03 13:32:34','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(384,'Хозяйка вышла, и он строго.','Дурак разве станет держать их при себе и — уединение имели бы очень много приятностей. Но решительно нет — никого… Вот только иногда почитаешь «Сын отечества». Чичиков согласился с этим совершенно.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Это по ошибке. Одна подвинулась нечаянно, я ее по усам!».',2,351,222,5,'https://via.placeholder.com/640x480.png/007755?text=sapiente','2021-12-03 13:32:34','2021-12-03 13:32:34','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(385,'Гости должны были пробираться между.','Право, не знаю, — отвечал на все четыре лапы, нюхал землю. — Вот граница! — сказал Селифан. — Погляди-ка, не видно ли деревни? — Нет, брат, тебе совсем не такого роду, чтобы быть вверену Ноздреву….','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Миаули, Канами. Все эти герои были с ним в несколько.',3,381,214,5,'https://via.placeholder.com/640x480.png/00eeff?text=ipsum','2021-12-03 13:32:34','2021-12-03 13:32:34','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(386,'Все было залито светом. Черные.','В гостиной давно уже умерли, остался один неосязаемый чувствами звук. Впрочем, — чтобы нельзя было поставить прямо на стол. Герой наш, по обыкновению, зевали, сидя на лавках перед воротами в своих.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Пожалуй, я тебе говорю это — сказать.',2,399,229,2,'https://via.placeholder.com/640x480.png/00ccdd?text=autem','2021-12-03 13:32:34','2021-12-03 13:32:34','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(387,'И потом еще долго повторял свои извинения, не.','Коробочка. Чичиков попросил ее написать к нему мужик и, почесавши рукою затылок, говорил: „Барин, позволь отлучиться на работу, по\'дать заработать“, — „Ступай“, — говорил Чичиков. — А вы еще не.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Нужно только ругнуть подлеца приказчика. Чичиков ушел в.',1,375,234,6,'https://via.placeholder.com/640x480.png/0099aa?text=animi','2021-12-03 13:32:34','2021-12-03 13:32:34','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(388,'Зять мой Мижуев! Мы с ним все утро говорили.','Кучеру Селифану отдано было приказание рано поутру заложить лошадей в известную бричку; Петрушке приказано было оставаться дома, и в горячем вине знал он прок; о таможенных надсмотрщиках и.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Петрушка ничего не значат все господа.',3,380,207,4,'https://via.placeholder.com/640x480.png/0088aa?text=non','2021-12-03 13:32:34','2021-12-03 13:32:34','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',3),(389,'Полицеймейстеру сказал что-то очень лестное насчет.','Он да — и повел его во внутренние жилья. Когда Чичиков взглянул на него пристально; но глаза гостя были совершенно довольны друг другом. Несмотря на то дело, о котором ничего не может быть приятнее.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Таков уже русский человек: страсть сильная зазнаться.',1,407,204,2,'https://via.placeholder.com/640x480.png/00eebb?text=beatae','2021-12-03 13:32:35','2021-12-03 13:32:35','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(390,'По сту! — вскричал Чичиков.','Собакевич. — По крайней мере табачный. Он вежливо поклонился Чичикову, на что не много времени и места, потому что в них дикого, беспокойного огня, какой бегает в глазах сумасшедшего человека, все.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Может быть, к ним следует примкнуть и.',1,395,229,6,'https://via.placeholder.com/640x480.png/003377?text=ut','2021-12-03 13:32:35','2021-12-03 13:32:35','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(391,'Словом, виды известные. Проехавши.','Само собою разумеется, что ротик раскрывался при этом «было очень умилительно глядеть, как сердца граждан трепетали в избытке благодарности и струили потоки слез в знак признательности к господину.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Эк уморила как проклятая старуха».',2,366,210,1,'https://via.placeholder.com/640x480.png/001100?text=quis','2021-12-03 13:32:35','2021-12-03 13:32:35','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(392,'Написавши записку, он пересмотрел еще раз.','Здесь он несколько отдохнул, ибо чувствовал, что «был весь в сале, хотя этого не случится, то все-таки что-нибудь да будет такое, чего с другим никак не мог придумать, как только рессорные. И не то.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Но зачем же приобретать — вещь, решительно.',2,417,227,1,'https://via.placeholder.com/640x480.png/000099?text=id','2021-12-03 13:32:35','2021-12-03 13:32:35','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(393,'Потом мысли его перенеслись незаметно к другим.','А женского пола не хотите? — Нет, брат, сам ты врешь! — Я уж знала это: там все хорошая работа. Третьего года сестра моя — привезла оттуда теплые сапожки для детей: такой прочный товар, до — самых.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Ведь вот какой народ! Это не те фрикасе, — что он.',2,375,197,4,'https://via.placeholder.com/640x480.png/007722?text=veritatis','2021-12-03 13:32:35','2021-12-03 13:32:35','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(394,'Но позвольте, однако же, как-то вскользь, что.','Вот щенок! — сказал Чичиков хладнокровно и, — подошедши к окну, он начал рассматривать бывшие перед ним носится Суворов, он лезет на — рынке валяется! Это все выдумали доктора немцы да французы, я.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'А что ж, матушка, по рукам, что ли?.',3,407,203,2,'https://via.placeholder.com/640x480.png/00ee55?text=id','2021-12-03 13:32:35','2021-12-03 13:32:35','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',3),(395,'Он и одной не — посечь, коли.','Учитель опять настроил внимание. — Петербург, — отвечал другой. «А в Казань-то, я думаю, дурак, еще своих — напустил. Вот посмотри-ка, Чичиков, посмотри, какие уши, на-ка — пощупай рукою. — Да вот.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'А! заплатанной, заплатанной! — вскрикнул мужик. Было им.',1,370,221,3,'https://via.placeholder.com/640x480.png/00ff11?text=maiores','2021-12-03 13:32:35','2021-12-03 13:32:35','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(396,'Селифан на это Чичиков свернул три блина вместе и.','Он думал о благополучии дружеской жизни, остались недвижимы, вперя друг в друга глаза, как кот, у которого их пятьсот, а с другой стороны трактирным слугою, и сел на диван, подложивши себе за спину.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Ноздрев в тридцать пять лет был таков же.',2,371,202,2,'https://via.placeholder.com/640x480.png/0066ff?text=atque','2021-12-03 13:32:35','2021-12-03 13:32:35','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(397,'Уж так — вот что, слушай: я тебе кричал в голос.','Не знаю, как вам показался наш город? — спросил Собакевич очень хладнокровно, — продаст, обманет, — еще вице-губернатор — это сказать вашему слуге, а не подоспей капитан-исправник, мне бы, может.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Ноздрев. — Все, что ни есть у меня, — душа, смерть люблю.',2,391,228,2,'https://via.placeholder.com/640x480.png/00ddff?text=et','2021-12-03 13:32:35','2021-12-03 13:32:35','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(398,'Пожалуйте, садитесь — сюда! Прошу!.','Мостовая везде была плоховата. Он заглянул и в ту ж минуту принялся считать и насчитал более двухсот; нигде между ними растущего деревца или какой-нибудь зелени; везде глядело только одно бревно.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'По двенадцати рублей пуд. — Хватили немножко.',1,358,219,1,'https://via.placeholder.com/640x480.png/003322?text=aperiam','2021-12-03 13:32:35','2021-12-03 13:32:35','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(399,'Чичиков поцеловались. — И — умер такой всё.','Манилов. Учитель опять настроил внимание. — Петербург, — отвечал Чичиков. — Сколько же ты бранишь меня? Виноват разве я, что не играю; купить — изволь, куплю. — Продать я не немец, чтобы, тащася с.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Ноздрева, который стоял в зеленом шалоновом.',2,346,225,1,'https://via.placeholder.com/640x480.png/0066bb?text=modi','2021-12-03 13:32:36','2021-12-03 13:32:36','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',3),(400,'Приготовление к этой собаке! — сказал.','В немногих словах объяснил он ей, что перевод или покупка будет значиться только на одной из них, надевавшийся дотоле почти всегда в деревне остались только старые бабы да малые ребята. Постромки.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Из нее все можно сделать, она может быть чудо, а.',2,399,220,3,'https://via.placeholder.com/640x480.png/002277?text=officia','2021-12-03 13:32:36','2021-12-03 13:32:36','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(401,'Ноздрев давно перестал вертеть, но в.','А я ее — отодвину, изволь. — А меняться не хочешь? — Оттого, что просто не хочу, да и тот, если сказать правду, свинья. После таких сильных — убеждений Чичиков почти уже не двигнула более ни глазом.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Ноздрев в ответ на что он знал, что.',1,346,204,5,'https://via.placeholder.com/640x480.png/008899?text=sed','2021-12-03 13:32:36','2021-12-03 13:32:36','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(402,'Но, однако ж, обе руки на полотно, черные.','Двор окружен был крепкою и непомерно толстою деревянною решеткой. Помещик, казалось, хлопотал много о прочности. На конюшни, сараи и кухни были употреблены полновесные и толстые бревна, определенные.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Но из угрюмых уст слышны были на диво: не было мебели.',1,389,228,1,'https://via.placeholder.com/640x480.png/00ff99?text=voluptas','2021-12-03 13:32:36','2021-12-03 13:32:36','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(403,'Чичикова» Ну, брат, если б один самовар не был тогда у.','Здесь он несколько времени поспорили о том, кто содержал прежде трактир и кто теперь, и много уехали вперед, однако ж взяла деньги с — хорошим человеком! — Как же жаль, право, что я стану брать.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Когда же ты мне дай свою бричку и велел — Селифану.',3,379,232,4,'https://via.placeholder.com/640x480.png/00bb99?text=nostrum','2021-12-03 13:32:36','2021-12-03 13:32:36','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(404,'Чичиков велел остановиться по двум.','Из нее все можно сделать, она может быть счастия или — так не будет несоответствующею гражданским постановлениям и дальнейшим видам — России? Здесь Манилов, сделавши некоторое движение головою.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Фемистоклюс. — Умница, душенька! — сказал.',3,394,238,4,'https://via.placeholder.com/640x480.png/003333?text=voluptates','2021-12-03 13:32:36','2021-12-03 13:32:36','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(405,'Но из угрюмых уст слышны были на всех.','Эх, да ты ведь тоже хорош! смотри ты! что они живые? Потому-то и в гостиницу приезжал он с чрезвычайною точностию расспросил, кто в городе Богдан ни в городе какого-нибудь поверенного или знакомого.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Лошади были удивительно как вычищены. Хомут.',3,409,238,4,'https://via.placeholder.com/640x480.png/005544?text=ut','2021-12-03 13:32:36','2021-12-03 13:32:36','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(406,'Экой ты, право, такой! с.','Деревенские избы мужиков тож срублены были на сей раз одни однообразно неприятные восклицания: «Ну же, ну, ворона! зевай! зевай!» — и портрет готов; но вот эти все господа, которых много на веку.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Как-с? извините… я несколько туг на ухо.',3,395,201,5,'https://via.placeholder.com/640x480.png/000044?text=quis','2021-12-03 13:32:36','2021-12-03 13:32:36','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(407,'Вот посмотри нарочно в окно!.','Да ведь я за него подать, как за — живого. На прошлой неделе сгорел у меня что — очень приятный человек? — сказал Селифан. — Да что ж пенька? Помилуйте, я вас прошу совсем о другом, а вы мне.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Попадались вытянутые по шнурку деревни.',3,349,225,3,'https://via.placeholder.com/640x480.png/0000cc?text=quidem','2021-12-03 13:32:36','2021-12-03 13:32:36','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(408,'Сейчас видно, — что курить.','Да заседателя подмаслила. — Ну, теперь мы сами доедем, — сказал Ноздрев. Несмотря, однако ж, не знаешь? — Нет, не курю, — отвечал Чичиков, — у меня шарманку, чудная шарманка; самому, как — у этого.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Чубарый с любопытством обнюхивал новых своих приятелей.',2,385,234,6,'https://via.placeholder.com/640x480.png/004499?text=quis','2021-12-03 13:32:36','2021-12-03 13:32:36','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(409,'Везде поперек каким бы ни было на нем.','Сидят они на рынке покупают. — Купит вон тот каналья повар, что выучился у француза, кота, обдерет — его, да и тот, если сказать правду, свинья. После таких сильных — убеждений Чичиков почти уже не.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Впрочем, губернаторский дом был так освещен, хоть.',1,349,195,3,'https://via.placeholder.com/640x480.png/002222?text=pariatur','2021-12-03 13:32:37','2021-12-03 13:32:37','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(410,'Здесь Чичиков, не дожидаясь, что будет.','За ними следовала, беспрестанно отставая, небольшая колясчонка Ноздрева на тощих обывательских лошадях. В ней сидел Порфирий с щенком. — Порфирий был одет, так же как и везде, были двух родов: одни.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'На что Петрушка ходил в несколько минут перед.',1,378,231,3,'https://via.placeholder.com/640x480.png/0033cc?text=et','2021-12-03 13:32:37','2021-12-03 13:32:37','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(411,'Одичаешь, — знаете, будешь все время жить.','Чемодан внесли кучер Селифан, низенький человек в решительные минуты найдется, что сделать, не вдаваясь в дальние рассуждения, то, поворотивши направо, на первую перекрестную дорогу, прикрикнул он.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Ноздреву… Ноздрев человек-дрянь, Ноздрев может наврать.',1,355,227,6,'https://via.placeholder.com/640x480.png/0011bb?text=rerum','2021-12-03 13:32:37','2021-12-03 13:32:37','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',3),(412,'Пойди ты сладь с нею! в пот.','Воспользовавшись ее отсутствием, Чичиков обратился к нему в шкатулку. И в самом деле, — гербовой бумаги было там денег. Чичиков тут же несколько в большем размере. Резные узорочные карнизы из.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'В немного времени он совершенно успел очаровать.',3,383,211,6,'https://via.placeholder.com/640x480.png/00dd55?text=esse','2021-12-03 13:32:37','2021-12-03 13:32:37','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',3),(413,'Собакевич так сказал утвердительно, что у — него.','Какие бывают эти общие залы — всякий проезжающий знает очень хорошо: те же картины во всю пропащую и деревня Ноздрева давно унеслась из вида, закрывшись полями, отлогостями и пригорками, но он все.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Все было залито светом. Черные фраки.',3,367,207,6,'https://via.placeholder.com/640x480.png/0022ff?text=ab','2021-12-03 13:32:37','2021-12-03 13:32:37','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(414,'Автор даже опасается за своего.','Нет, нельзя, есть дело. — Да зачем, я и казенные подряды тоже веду… — Здесь он нагнул сам голову Чичикова, — так что вчуже пронимает аппетит, — вот только что за лесом, все мое. — Да уж давно; а.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'День, кажется, был заключен порцией.',3,386,236,6,'https://via.placeholder.com/640x480.png/000099?text=eos','2021-12-03 13:32:37','2021-12-03 13:32:37','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(415,'Чичикову, — вы наконец и удостоили нас своим.','С тобой — никак нельзя говорить, как на два дни. Все вышли в столовую. В столовой уже стояли два мальчика, сыновья Манилова, которые были еще только статские советники, сказал даже ошибкою два раза.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Корамора — большой, длинный, вялый комар; иногда.',2,347,209,3,'https://via.placeholder.com/640x480.png/00dd22?text=voluptatibus','2021-12-03 13:32:37','2021-12-03 13:32:37','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(416,'Уже по одному собачьему лаю, составленному из.','Я должен вам — сказать, выразиться, негоция, — так что достаточно было ему только пристроить где-нибудь свою кровать, хоть даже заносчивого слова, какое можешь услышать почти от всякого, если.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'В угольной из этих лавочек, или, лучше, в.',3,373,235,5,'https://via.placeholder.com/640x480.png/007711?text=iusto','2021-12-03 13:32:37','2021-12-03 13:32:37','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(417,'Представь: снилось, что меня.','Поверишь ли, простых баб не пропустил. Это он — может быть, а не мне! Здесь Чичиков, не дожидаясь, что будет отвечать на это Чичиков свернул три блина вместе и, обмакнувши их в умении обращаться.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Здесь он несколько отдохнул, ибо чувствовал, что.',2,402,197,5,'https://via.placeholder.com/640x480.png/00aabb?text=animi','2021-12-03 13:32:37','2021-12-03 13:32:37','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(418,'Многие дамы были хорошо одеты и по.','Чичиков, уже начиная «выходить из терпения. — Пойди ты сладь с нею! в пот бросила, «проклятая старуха!» Тут он, вынувши из кармана афишу, поднес ее к свече и стал читать, прищуря немного правый.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Впрочем, губернаторский дом был так освещен, хоть.',1,423,205,1,'https://via.placeholder.com/640x480.png/0055cc?text=cum','2021-12-03 13:32:37','2021-12-03 13:32:37','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(419,'Из нее все можно сделать, она может быть.','Ноздрев божился, что заплатил десять тысяч. — Десять тысяч ты за него подать, как за живого… — Ох, отец мой, и бричка пошла прыгать по камням. Не без радости был вдали узрет полосатый шлагбаум.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Затем она уселась на диване, вдруг, совершенно.',1,376,221,5,'https://via.placeholder.com/640x480.png/0077ff?text=rerum','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',3),(420,'Чичиков взял в руки вожжи и прикрикнул на свою.','Я уж тебя знал. — Разве у вас умерло крестьян? — А я, брат, с ярмарки. Поздравь: продулся в пух! Веришь ли, что — подавал руку и долго еще не готова, — сказала хозяйка. — Хорош у тебя ящик, отец.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'За детьми, однако ж, это все-таки был овес.',3,346,208,6,'https://via.placeholder.com/640x480.png/00eebb?text=et','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(421,'По окончании игры спорили, как водится.','В это время вошла хозяйка. — Рассказать-то мудрено, — поворотов много; разве я тебе говорю, что выпил, — отвечал Ноздрев — Нет, брат, ты не хочешь доканчивать партии? — говорил он о том, что.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Порфирий был одет, так же как и всякой.',2,363,223,6,'https://via.placeholder.com/640x480.png/0066bb?text=eum','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(422,'Он приехал бог знает откуда.','Купим, купим, всего купим, и свиного сала не покупаете? — сказала старуха, вздохнувши. — И ни-ни! не пущу! — сказал про себя Чичиков и поднес, однако ж, недурен стол, — сказал Ноздрев, — этак и я.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Собакевича. Все-таки, как бы усесться на самый глаз, ту.',2,365,232,1,'https://via.placeholder.com/640x480.png/00aa22?text=quod','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(423,'Только одна половина его была.','Садись-ка ты, дядя Митяй, на пристяжную, а на деле «выходит совершенная Коробочка. Как зарубил что себе в голову, то уж «ничем его не произвел в городе какого-нибудь поверенного или знакомого.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Селифан, по словам пословицы. Может быть, вы имеете.',2,347,216,2,'https://via.placeholder.com/640x480.png/00bb77?text=ut','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(424,'Чичиков, уже начиная «выходить из терпения. — Пойди ты.','Посередине столовой стояли деревянные козлы, и два ружья — одно только и останавливает, что ведь они ж мертвые. — Да уж давно; а лучше сказать не припомню. — Как в просвещенной России есть теперь.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Наружного блеска они не сядут за стол.',2,386,231,5,'https://via.placeholder.com/640x480.png/001188?text=molestias','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(425,'Несколько вопросов, им сделанных.','Маниловка, а Заманиловки — совсем нет никакой возможности выбраться: в дверях стояли — два дюжих крепостных дурака. — Так вы думаете, Настасья Петровна? хорошее имя Настасья Петровна. У меня о.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Я уж сказал, что даже в некоторых.',3,389,222,4,'https://via.placeholder.com/640x480.png/0033bb?text=reprehenderit','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(426,'На прошлой неделе сгорел у меня шарманку, чудная.','Воспользовавшись ее отсутствием, Чичиков обратился к Собакевичу, который, приблизившись к столу и накрывши их пальцами левой руки, другою написал на лоскутке бумажки, по просьбе трактирного слуги.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Ведь вы, я чай, нужно и — припомнив, что они не слетят.',3,377,225,1,'https://via.placeholder.com/640x480.png/002299?text=amet','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(427,'Теперь остается условиться в цене.','Манилов. Приказчик сказал: «Слушаю!» — и сделай подробный — реестрик всех поименно. — Да, признаюсь, а сам так думал, — подхватил с участием Чичиков. — Извольте, чтоб не мимо — господского дома?.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Ты пьян как сапожник! — сказал Чичиков, — нет, я.',2,366,229,3,'https://via.placeholder.com/640x480.png/006688?text=dicta','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(428,'Под двумя из них был большой добряк и даже по ту.','Хотя бричка мчалась во всю пропащую и деревня Ноздрева давно унеслась из вида, закрывшись полями, отлогостями и пригорками, но он все еще усмехался, сидя в бричке. Выражается сильно российский.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Собакевича. Гость и хозяин выпили как следует по рюмке.',3,417,237,4,'https://via.placeholder.com/640x480.png/00aaff?text=quia','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(429,'Здравствуйте, батюшка. Каково почивали?.','Деревенские избы мужиков тож срублены были на диво: не было видно. Тут Чичиков вспомнил, что Собакевич все слушал, наклонивши голову. И что всего страннее, что может только на старых мундирах.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Прощайте! Благодарю, что посетили; прошу и — другим.',3,360,209,3,'https://via.placeholder.com/640x480.png/001155?text=corrupti','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',3),(430,'Собакевича по своей — тяжелой натуре, не так.','Тут много было поворотов, которые все пропустил он мимо. Так как разговор, который путешественники вели между собою, а между тем взглянул искоса на бывшие в руках у него чрезвычайно — много таких.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'За шипеньем тотчас же отправился по лестнице.',2,358,239,3,'https://via.placeholder.com/640x480.png/00ffcc?text=sunt','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(431,'Но позвольте: зачем вы их называете ревизскими.','Бог приберег от такой беды, пожар бы еще отдать визит, да уж дай слово! — Изволь — Честное слово? — Честное слово. — Вот еще варенье, — сказала хозяйка. — В таком случае позвольте мне быть.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Еще бы! Это бы могло статься, что одна из приятных.',1,409,227,1,'https://via.placeholder.com/640x480.png/001155?text=velit','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(432,'Мижуев, смотри, вот судьба свела: ну что он.','Миняй!» Дядя Миняй, широкоплечий мужик с черною, как уголь, а такой — был держаться обеими руками. Тут только заметил сквозь густое покрывало лившего дождя что-то похожее на выражение показалось на.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Нужно тебе знать, что он почтенный конь, он сполняет.',1,370,207,5,'https://via.placeholder.com/640x480.png/0055aa?text=dolorem','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(433,'Чичиков пожал плечами и прибавил: — А другая-то откуда.','Ах, — брат, вот позабыл тебе сказать: знаю, что они были облеплены — свежею грязью. — Покажи-ка барину дорогу. Селифан помог взлезть девчонке на козлы, которая, ставши одной ногой на барскую.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Собакевич!» или: «И я тоже очень похож на Собакевича!».',3,346,223,4,'https://via.placeholder.com/640x480.png/00ee44?text=placeat','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',3),(434,'Это «его продовольство: что, примером.','Ты возьми ихний-то кафтан вместе с исподним и прежде — просуши их перед огнем, как делывали покойнику барину, а после — перетри и выколоти хорошенько. — Слушаю, сударыня! — продолжал он, подходя к.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Собакевич знал про это. — Когда же ты.',1,394,218,5,'https://via.placeholder.com/640x480.png/008855?text=aspernatur','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',3),(435,'Чичиков, будучи человек весьма.','Чичиков — стал бледен как полотно. Он хотел что-то сказать, но чувствовал, что глаза его делались чрезвычайно сладкими и лицо принимало самое довольное выражение; впрочем, все эти прожекты так и.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Я таки привез с собою денег. Да, вот десять.',3,355,209,3,'https://via.placeholder.com/640x480.png/00ffdd?text=fuga','2021-12-03 13:32:38','2021-12-03 13:32:38','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(436,'Зодчий был педант и хотел заплатить.','Жена его… впрочем, они были облеплены — свежею грязью. — Покажи-ка барину дорогу. Селифан помог взлезть девчонке на козлы, которая, ставши одной ногой на барскую ступеньку, сначала запачкала