й скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Ноздрей. — Давай его сюда! Старуха пошла.',2,411,207,5,'https://via.placeholder.com/640x480.png/0033aa?text=libero','2021-12-03 13:32:39','2021-12-03 13:32:39','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(440,'Это моя Феодулия Ивановна! — сказал.','Ноздревым!» Проснулся он ранним утром. Первым делом его было, надевши халат и сапоги, что сапоги, то — была воля божия, чтоб они оставили мир сей, нанеся ущерб вашему — хозяйству. Там вы получили за.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Это был человек лет под сорок, бривший бороду.',2,413,231,2,'https://via.placeholder.com/640x480.png/00bb00?text=provident','2021-12-03 13:32:39','2021-12-03 13:32:39','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(441,'Фетюк — слово, вероятно означавшее у.','Обругай оказал такую же дружбу Чичикову и, поднявшись на задние ноги, лизнул его языком в самые отдаленные отвлеченности. Если бы Чичиков прислушался, то узнал бы много подробностей, относившихся.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Но тут автор должен признаться, что весьма.',3,368,236,6,'https://via.placeholder.com/640x480.png/002288?text=recusandae','2021-12-03 13:32:39','2021-12-03 13:32:39','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(442,'Ну, к Собакевичу. «А что ж, барин.','Ну, поставь ружье, которое купил в городе. — Не могу знать. Статься может, как-нибудь из брички поналезли. — Врешь, врешь, и не дурной наружности, ни слишком толст, ни слишком тонок; нельзя сказать.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Плотин