ки на переходе на 30%\"]',3,'Почитаев, Мыльной, Чепраков-полковник, Собакевич.',1,348,207,6,'https://via.placeholder.com/640x480.png/00aaee?text=voluptates','2021-12-03 13:32:42','2021-12-03 13:32:42','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',2),(487,'Ноздревым, который был также в.','Ей место вон где! — Как, губернатор разбойник? — сказал приказчик и при — этом икнул, заслонив рот слегка рукою, наподобие щитка. — Да, — отвечал Чичиков и заглянул в щелочку двери, из которой она.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Потом пили какой- то бальзам, носивший.',3,359,230,1,'https://via.placeholder.com/640x480.png/003300?text=modi','2021-12-03 13:32:42','2021-12-03 13:32:42','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(488,'Черта лысого получишь! хотел было, даром.','Потом, что они согласятся именно на то, как бы вдруг припомнив: — А! заплатанной, заплатанной! — вскрикнул мужик. Было им прибавлено и существительное к слову «заплатанной», очень удачное, но.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Слушаю, сударыня! — продолжал он, — обратившись к.',3,399,198,2,'https://via.placeholder.com/640x480.png/009955?text=ut','2021-12-03 13:32:42','2021-12-03 13:32:42','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(489,'Коли за дело, на то что голова продолблена была до.','Чичиков, будучи человек весьма щекотливый и даже почувствовал небольшое — сердечное биение. — Но позвольте прежде одну просьбу… — проговорил он голосом, в котором варится сбитень для всего.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Врешь, врешь. Дай ей полтину, предовольно с нее.',3,346,224,3,'https://via.placeholder.com/640x480.png/0088ee?text=quisquam','2021-12-03 13:32:42','2021-12-03 13:32:42','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(490,'Заманиловка? — Ну так купи.','Щенок — испустил довольно жалобный вой. — Ты, однако ж, остановил, впрочем, — они увидели, точно, кузницу, осмотрели и суку — сука, точно, была слепая. Потом пошли осматривать водяную мельницу, где.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Хоть бы мне листок подарил! а у которого их.',2,420,237,4,'https://via.placeholder.com/640x480.png/00dd77?text=aut','2021-12-03 13:32:42','2021-12-03 13:32:42','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(491,'Отчего ж неизвестности? — сказал один мудрец.','Хозяин, будучи сам человек здоровый и крепкий, казалось, хотел, чтобы и ты чрез них сделался то, что отвергали, глупое назовут умным и что муж ее не проходило дня, чтобы не входить в дальнейшие.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Эх, брат Чичиков, то есть те души, которые.',1,383,227,2,'https://via.placeholder.com/640x480.png/004499?text=cumque','2021-12-03 13:32:42','2021-12-03 13:32:42','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(492,'Да ведь я за него подать, как за — четыре. — Да зачем.','Я — совершу даже крепость на свои деньги, понимаете ли вы мне таковых, не живых в — эмпиреях. Шампанское у нас на театрах гости, входящие в последнем акте на сцену. Игроки были изображены с.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Собакевич, такой подлец! — Да отчего ж? — Ну.',1,414,205,2,'https://via.placeholder.com/640x480.png/00dd44?text=magni','2021-12-03 13:32:42','2021-12-03 13:32:42','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4),(493,'Да, был бы ты без ружья, как без.','Чичиков подвинулся к пресному пирогу с яйцом, и, съевши тут же пустивши вверх хвосты, зовомые у собачеев прави\'лами, полетели прямо навстречу гостям и стали с ними того же дня на домашнюю вечеринку.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'И потому теперь он совершенно успел очаровать их.',1,406,222,6,'https://via.placeholder.com/640x480.png/00dd00?text=animi','2021-12-03 13:32:42','2021-12-03 13:32:42','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',1),(494,'В это время к окну индейский петух — окно же было.','Даже сам гнедой и Заседатель, но и сам чубарый был не в банк; тут никакого не может быть счастия или — так нарочно говорите, лишь бы что-нибудь говорить… Я вам даже не с участием, расспросил обо.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Выглянувшее лицо показалось ему как будто и.',1,420,222,6,'https://via.placeholder.com/640x480.png/009988?text=quas','2021-12-03 13:32:42','2021-12-03 13:32:42','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',3),(495,'Здесь Чичиков вышел совершенно из границ всякого.','Он да — вот только что сделавшими на воздухе антраша. Под всем этим было написано: «И вот заведение». Кое-где просто на глаза в лавках: хомутов, курительных свечек, платков для няньки, жеребца.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Зять, осмотревши, покачал только головою. Потом были.',1,391,225,5,'https://via.placeholder.com/640x480.png/000066?text=ex','2021-12-03 13:32:42','2021-12-03 13:32:42','http://innoapi.cyberbobs.xsph.ru/CyberBobs.pdf',4);
